@mechanical.catnip
@grei_rivero13
@lucasfforte 
@luciamilagroos
Santiago Walter
@candecuinas_
@anaclararte
@aprilpaleari
@leonelbustos.bailalo
@anaclararte

SAPO PARADO

Con mi jean remaxado camino a todos lados
Pared de color menta y mi viejo borracho
En el piso tirado con el orto reventado y yo en el baño encerrado
bellos recuerdos que quedan en mi, en mi cuerpo tatuados

Y me corté el flequillo parezco rollinga
camino y me gritan ahi va una distinta
voy flow campamento anticapitalista
pero soy mas mala que una fascista

tengo una cita que saqué de la web
y cené bizcochuelo y un poco de té
tengo las piernas flacas y el cuerpo hinchado
me miro al espejo soy un sapo parado

gorda estas gorda, 
mira lo que sos, largá la galletita, 
asco asco me das, 
mira ese cuerpo hinchado, 
así nadie te va a querer, 
sos un sapo parado

Shampoo en 12 cuotas tu novio está con otra
y yo soy esa otra no fue culpa mia
perdón amiga mia, me pasa por ser linda
no me tengas envidia no seas resentida

medialunas del dia lolipasteleria
cierro las cortinas porque la luna mira
Ayuno permanente, mareada y re caliente
que pase el siguiente

Sapo parado yo? que flashastes?
callate gorda lagarto o te dejo al sol
Mírame a mi y mírate a vos, que fea que sos
Igual es un chiste todo es con humor MOOOR

Para qué tenés hijos si no tenés para el funeral? dont care
Y a mi que me puede importar si estoy con fazza, el rey de dubai?
Me voy de viaje sola a hacer tramites con la cola
los estados unidos de norteamerica me esperan!

sidni wini

